const InterestTableElements = ({data}) => {
  console.log(data)
  return (
    <tr>
      <td>{data.year}</td>
      <td>{data.savings}</td>
      <td>{data.interestGain}</td>
      <td>{data.gained}</td>
      <td>{data.Capital}</td>
    </tr>
  );
};

export default InterestTableElements;
